import React from "react";

export default function Filme({movie}) {
  //console.log(movie);
  return (
    <div>


          <p>{movie.titulo}</p>
          {/*<p>{movie.titulo2}</p>*/}
          <p>{movie.capaDoFilme}</p>
          {/*<p>{movie.capaDoFilme2}</p>*/}
          <p>{movie.sinopse}</p>
          <p>{movie.diretor}</p>
          <p>{movie.trailer}</p>
          {/*<p>{movie.url}</p>*/}

        {/*<h1>{movie.titulo}</h1>*/}
    </div>
  );
}
